import React from "react";
import "./about.scss";

const About = () => {
  return (
    <section className="about">
      <div className="header">
        {/*<img src={process.env.PUBLIC_URL + "/images/hockey-me.jpg"} />*/}
        <h1>About</h1>
        <p>I am 2 6 years old and was born and raised in Stockholm</p>
      </div>
    </section>
  );
};
export default About;
